import React from 'react';
import Header from './Header';
import './app.css';
import Post from './Post';

function App() {
  return (
    <div className='app'>
      <Header />
      <Post
        username='ritam_rahman'
        imageUrl='https://images.unsplash.com/photo-1539946309076-4daf2ea73899?ixlib=rb-1.2.1&auto=format&fit=crop&w=750&q=80'
        caption='wow! its works'
      />
      <Post />
      <Post />
      <Post />
      <Post />
    </div>
  );
}

export default App;
